import React from 'react';

function Navigation() {
    return <nav>
        <ul>
            <li><a href="1">O mne</a></li>
            <li><a href="2">Moje projekty</a></li>
            <li><a href="3">Moje schopnosti</a></li>
            <li><a href="4">Contact me</a></li>
        </ul>
    </nav>
}



export default Navigation;
